import React from 'react';

function Work() {
  return (
    <section id="work" className="py-5 bg-dark text-white">
      <div className="container">
        <h2 className="display-4 text-orange mb-4">My Work</h2>
        <p>Explore some of my key projects below. Each project focuses on innovative design solutions in UX, audio design, and haptics.</p>
      </div>
    </section>
  );
}

export default Work;
